import React from "react";
import styles from "./Navbar.module.css";

const Navbar = () => {
  return (
    <nav className={styles.navbar}>
      <h1 className={styles.logo}>I AM MUSIC</h1>
      <button className={styles.link}>Learn More</button>
    </nav>
  );
};

export default Navbar;
